import { Link } from "react-router-dom";
import React from "react";

const ProductsPage = () => {
  return (
    <div>
      <h1>My Products Page</h1>

      <ul>
        {PRODUCTS.map((item) => (
          <li>
            <Link to={`/products/${item.id}`}></Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ProductsPage;
